import React, { useState } from "react";

const universities = [
  {
    name: "Massachusetts Institute of Technology (MIT)",
    qsGeneralRank: 1,
    subjects: {
      "Computer Science": {
        qsRanking: {
          2025: 1,
          2024: 1,
          2023: 2,
          2022: 1,
          2021: 1,
        },
        gpaCutoff: {
          2025: 3.8,
          2024: 3.7,
          2023: 3.7,
          2022: 3.6,
          2021: 3.6,
        },
        satCutoff: {
          2025: 1500,
          2024: 1480,
          2023: 1450,
          2022: 1430,
          2021: 1400,
        },
        intake: "August",
        deadline: "January 1",
        fees: {
          international: "$53,790",
          domestic: "$53,790"
        }
      },
      Engineering: {
        qsRanking: {
          2025: 1,
          2024: 1,
          2023: 1,
          2022: 1,
          2021: 1
        },
        gpaCutoff: {
          2025: 3.9,
          2024: 3.8,
          2023: 3.8,
          2022: 3.7,
          2021: 3.6
        },
        satCutoff: {
          2025: 1520,
          2024: 1500,
          2023: 1470,
          2022: 1450,
          2021: 1420
        },
        intake: "September",
        deadline: "February 1",
        fees: {
          international: "$54,200",
          domestic: "$54,200"
        }
      }
    }
  },
  {
    name: "Stanford University",
    qsGeneralRank: 2,
    subjects: {
      "Computer Science": {
        qsRanking: {
          2025: 2,
          2024: 2,
          2023: 3,
          2022: 2,
          2021: 2
        },
        gpaCutoff: {
          2025: 3.7,
          2024: 3.7,
          2023: 3.6,
          2022: 3.6,
          2021: 3.5
        },
        satCutoff: {
          2025: 1490,
          2024: 1470,
          2023: 1440,
          2022: 1420,
          2021: 1400
        },
        intake: "September",
        deadline: "January 15",
        fees: {
          international: "$55,473",
          domestic: "$55,473"
        }
      }
    }
  }
];

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState("");
  const [selectedSubject, setSelectedSubject] = useState("");
  const [studentType, setStudentType] = useState("international");
  const [cgpa, setCgpa] = useState("");
  const [satScore, setSatScore] = useState("");
  const [reports, setReports] = useState([]);

  const handleSave = () => {
    const subjectDetails =
      universities
        .find((uni) => uni.name === selectedUniversity)
        ?.subjects?.[selectedSubject];

    if (!subjectDetails) return;

    const latestYear = Math.max(...Object.keys(subjectDetails.qsRanking));
    const admissionProbability =
      parseFloat(cgpa) >= subjectDetails.gpaCutoff[latestYear] &&
      parseInt(satScore) >= subjectDetails.satCutoff[latestYear]
        ? "High"
        : "Moderate";

    setReports([
      ...reports,
      {
        university: selectedUniversity,
        subject: selectedSubject,
        cgpa,
        satScore,
        fees: subjectDetails.fees[studentType],
        deadline: subjectDetails.deadline,
        intake: subjectDetails.intake,
        admissionProbability
      }
    ]);
  };

  const selectedUniversityData = universities.find(
    (u) => u.name === selectedUniversity
  );

  const subjectDetails =
    selectedUniversityData?.subjects?.[selectedSubject];

  return (
    <div className="App">
      <h1>QS University Admission Predictor</h1>

      <div>
        <label>University: </label>
        <select
          value={selectedUniversity}
          onChange={(e) => {
            setSelectedUniversity(e.target.value);
            setSelectedSubject("");
          }}
        >
          <option value="">Select University</option>
          {universities.map((uni) => (
            <option key={uni.name} value={uni.name}>
              {uni.name}
            </option>
          ))}
        </select>
      </div>

      {selectedUniversity && (
        <div>
          <h2>{selectedUniversity}</h2>
          <p><strong>QS General Rank:</strong> #{selectedUniversityData.qsGeneralRank}</p>

          <label>Subject: </label>
          <select
            value={selectedSubject}
            onChange={(e) => setSelectedSubject(e.target.value)}
          >
            <option value="">Select Subject</option>
            {Object.keys(selectedUniversityData.subjects).map((subj) => (
              <option key={subj} value={subj}>
                {subj}
              </option>
            ))}
          </select>
        </div>
      )}

      {selectedSubject && subjectDetails && (
        <div>
          <h3>Details for {selectedSubject}</h3>
          <table border="1">
            <thead>
              <tr>
                <th>Year</th>
                <th>QS Rank</th>
                <th>GPA Cutoff</th>
                <th>SAT Cutoff</th>
              </tr>
            </thead>
            <tbody>
              {Object.keys(subjectDetails.qsRanking)
                .sort((a, b) => b - a)
                .map((year) => (
                  <tr key={year}>
                    <td>{year}</td>
                    <td>{subjectDetails.qsRanking[year]}</td>
                    <td>{subjectDetails.gpaCutoff[year]}</td>
                    <td>{subjectDetails.satCutoff[year]}</td>
                  </tr>
                ))}
            </tbody>
          </table>

          <p>
            <strong>Course Intake:</strong> {subjectDetails.intake}
          </p>
          <p>
            <strong>Application Deadline:</strong> {subjectDetails.deadline}
          </p>
          <p>
            <strong>Fees ({studentType}):</strong>{" "}
            {subjectDetails.fees[studentType]}
          </p>
        </div>
      )}

      <div>
        <label>Student Type: </label>
        <select
          value={studentType}
          onChange={(e) => setStudentType(e.target.value)}
        >
          <option value="international">International</option>
          <option value="domestic">Domestic</option>
        </select>
      </div>

      <div>
        <label>CGPA: </label>
        <input
          type="number"
          value={cgpa}
          onChange={(e) => setCgpa(e.target.value)}
        />
      </div>

      <div>
        <label>SAT Score: </label>
        <input
          type="number"
          value={satScore}
          onChange={(e) => setSatScore(e.target.value)}
        />
      </div>

      <button onClick={handleSave}>Save Report</button>

      <h2>Saved Reports</h2>
      <table border="1">
        <thead>
          <tr>
            <th>University</th>
            <th>Subject</th>
            <th>CGPA</th>
            <th>SAT Score</th>
            <th>Fees</th>
            <th>Deadline</th>
            <th>Intake</th>
            <th>Admission Probability</th>
          </tr>
        </thead>
        <tbody>
          {reports.map((r, idx) => (
            <tr key={idx}>
              <td>{r.university}</td>
              <td>{r.subject}</td>
              <td>{r.cgpa}</td>
              <td>{r.satScore}</td>
              <td>{r.fees}</td>
              <td>{r.deadline}</td>
              <td>{r.intake}</td>
              <td>{r.admissionProbability}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
